        image: "img/sample3.png"

    },
    {
        name : "baraclaba",
        madeby : "Ian",
        image: "img/sample4.png"
    },
    )

    return(
        <Box>
        <Grid container >
            {samples.map( (sample , index) => (
                <Grid item key={index} md={2} xs={2}>
                    {sample.name}
                </Grid>
            ))}
        </Grid>
        </Box>
    );
}

export default Like;
